import React, { useRef, useEffect } from 'react';
import videojs from 'video.js';
import 'video.js/dist/video-js.css';

export default function VideoPage() {
  const videoRef = useRef(null);
  const playerRef = useRef(null);

  useEffect(() => {
    // Make sure the ref is available before initializing
    if (videoRef.current) {
      playerRef.current = videojs(videoRef.current, {
        controls: true,
        width: 720,
        height: 420,
      });

      // Dispose of the player on cleanup
      return () => {
        if (playerRef.current) {
          playerRef.current.dispose();
        }
      };
    }
  }, []);

  const videoSrc = "/Enrique Iglesias - I Like It.mp4"; // Ensure the path is correct

  return (
    <div className="video-container">
      <h1>Introduction to Cyber Safety</h1>
      <div data-vjs-player>
        <video ref={videoRef} className="video-js vjs-default-skin" controls preload="auto">
          <source src={videoSrc} type="video/mp4" />
        </video>
      </div>
      <div className="video-footer">
        <button className="back-button" onClick={() => window.history.back()}>Back</button>
      </div>
    </div>
  );
}
